// src/pages/MoodSetterPage.jsx
import React from 'react';
import MoodSetter from '../components/MoodSetter';

function MoodSetterPage() {
  return (
   <div className="flex flex-col items-center p-8 min-h-screen bg-cover bg-center" style={{ backgroundImage: "url('/images/mood-bg.jpg')" }}>
      <h1 className="text-3xl font-bold text-white mb-6">Your Mood Insights & Suggestions</h1>
      <p className="text-white text-lg">Based on your chat, we'll provide you with suggestions to improve your mood.</p>
      {/* Later you can display mood history here */}
    </div>
  );
}

export default MoodSetterPage;
